import React    from 'react'
import ReactDOM from 'react-dom'
import styled, { createGlobalStyle }   from 'styled-components'


const GlobalStyle = createGlobalStyle`
    * {
        padding : 0;
        margin  : 0;
    }
    li {
        text-align      : center;
        margin          : 25px;
        list-style-type : none;
        border-radius   : 50px;
        background      : #ededed;
        font-size       : 36px;
        width           : 581px;
        height          : 88px;
        line-height:
    }
    body {
        background : #2b59a2
    }
`
const App = styled.div`
    height        : 160px;
    background    : #ededed;
    border-bottom : 5px solid #000;
`
const Text = styled.h1`
    color       : #e9c46a;
    text-align  : center;
    font-size   : 60px;
    padding-top : 40px;
`

const root = document.getElementById('root')
ReactDOM.render (
<div>    
    <GlobalStyle />
    <App>
        <Text> Estante de Livros </Text>
    </App>
    <ul>
        <li> Fight Club    </li>
        <li> Infinite Jest </li>
    </ul>
</div>
, root)
